import React, { Component } from 'react';
import './css/Footer.css';

export class Footer extends Component {

    render() {
            const x = 100;
            const y = 100;
            const styles = { 
                transform: `translate(${x}px, ${y}px)` 
            };

            return (
                <div style={styles}></div>
        );

        return (
            <footer>
                <div>
                    <text className="zoom">im here </text>
                </div>
            </footer>
        )
    }
}

export default Footer;
